    /* wtpNetElementCode(3)/DisplayString/ASN_OCTET_STR/char(char)//L/A/W/e/R/d/H */
    case COLUMN_WTPNETELEMENTCODE:
        rowreq_ctx->column_set_flags |= FLAG_WTPNETELEMENTCODE;
        rc = wtpNetElementCode_undo_setup(rowreq_ctx );
        break;

    /* wtpRemoteRestartFun(6)/INTEGER/ASN_INTEGER/long(u_long)//l/A/W/E/r/d/h */
    case COLUMN_WTPREMOTERESTARTFUN:
