    case COLUMN_WTPDEFENCEDOSATTACK:
        rowreq_ctx->column_set_flags |= FLAG_WTPDEFENCEDOSATTACK;
        rc = wtpDefenceDOSAttack_undo_setup(rowreq_ctx );
        break;

    /* wtpIGMPSwitch(12)/INTEGER/ASN_INTEGER/long(u_long)//l/A/W/E/r/d/h */
    case COLUMN_WTPIGMPSWITCH:
