        rowreq_ctx->column_set_flags |= FLAG_WTPCURRAPMODE;
        rc = wtpCurrAPMode_undo_setup(rowreq_ctx );
        break;

    /* wtpSupport11B(15)/INTEGER/ASN_INTEGER/long(u_long)//l/A/W/E/r/d/h */
    case COLUMN_WTPSUPPORT11B:
